import React, { useEffect, useState } from "react";

import Arrow from '../../../../../1_image_or_icon/Arrow_Button_DownAhead.png'

export const Detail_Image_Section = (props) => {

    const [FirstTouch, updateStart] = useState(0)
    const [LastTouch, updateLast] = useState(0)
    const [Distance, updateDistance] = useState(0)

    const [Highlighter, updateHighlight] = useState([
        'blue', 'black', 'black'])

    useEffect(()=>{
    },[])

    const photo_dispenser = (input) => {

        switch(typeof input){
            case('object'):
            // console.log(input[0].getUrl())
            return <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent:'start',
                        width:'60vw',
                        overflow: 'scroll',
                        aspectRatio: '1',
                        border: 'black solid 3.5px',
                        borderRadius: '15px'
                    }}
                    
                    

                    onTouchStart={(e)=>{
                        const touches = e.changedTouches[0].pageX;
                        updateStart(touches)

                    }}

                    onTouchEnd={async (e)=>{
                        const touches = e.changedTouches[0].pageX
                        updateLast(touches)

                        const Arrow = FirstTouch - LastTouch
                        switch(typeof e.target.parentNode.childNodes.length){

                                case('number'):

                                const Length = e.target.parentNode.childNodes.length

                                if(Arrow>100){
                                updateDistance(Distance+e.target.offsetWidth)

                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance+e.target.offsetWidth,
                                    behavior:'smooth'
                                })
                                
                                if(Distance>e.target.offsetWidth*(Length-1)){
                                    updateDistance(e.target.offsetWidth*Length)
                                }
                                break;
                                return;}

                                if(Arrow<-100){
                                updateDistance(Distance-e.target.offsetWidth)

                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance-e.target.offsetWidth,
                                    behavior:'smooth'
                                })

                                if(Distance<1){
                                    updateDistance(0)
                                }
                                break;
                                return;}
                                
                                if(-100<Arrow<100){
                                    
                                e.target.parentNode.scrollTo({
                                    top:0,
                                    left:Distance,
                                    behavior:'smooth'
                                    })}
                        
                                case('undefined'): 
                                break;
                                return;

                            }
                                // if(Distance>e.target.offsetWidth*(e.target.parentNode.childNodes.length-2)){
                                // console.log(Distance,'last')
                                // updateHighlight([
                                //     'black', 'black', 'blue'
                                // ])}

                        }
                    }

                    >

                        {input.map((element)=>{
                        return <img
                        style={{
                            width:'60vw',
                            objectFit: 'cover'
                        }}
                        src={element.getUrl()}
                        >
                        </img>
                        })}

                    </div>

            case('undefined'):
            return;
        }

    }

    const photos_Dot_Index = (input) => {
        switch(typeof input){
            case('object'):
            
            return <React.Fragment>

            <div
                style={{
                    fontSize: '10vw',
                    display: 'flex',
                    flexDirection: 'row',
                    justifyContent: 'center'
                }}
            >
            <span
             style={{
                color:`${Highlighter[0]}`
             }}
            >&#8226;</span>
            <span
             style={{
                color:`${Highlighter[1]}`
             }}
            >&#8226;</span>
            <span
             style={{
                color:`${Highlighter[2]}`
             }}
            >&#8226;</span>
            </div>

            </React.Fragment>

            case('undefined'):
            return;
        }
    }

    const start_dispenser = (input) => {
        let container = [];
        for(let i=0; i<input; i++){
            container.push("\u2B50")
        }
        return <div>
            {container.map((element)=>{
                return <span>{element}</span>
            })}
        </div>
        
    }

    const review_text_dispenser = (input) => {

        switch(typeof input){
            case('string'):

            switch(input.length>50){
                case(true):
                return <React.Fragment>
                
                <div
                style={{
                    maskImage: 'linear-gradient(black, transparent)'
                }}
                >
                    {input.slice(0,49)}
                </div>
                <div
                style={{
                    width:'inherhit',
                    display:'flex',
                    justifyContent:'center',
                    padding: '0.5vh'
                }}>
                    <img
                    src={Arrow}
                    ></img>
                </div>
                </React.Fragment>

                case(false):
                return <span>
                {input}
                </span>
            }
            
            case('undefined'):
            return;
        }
    }

    const review_dispenser = (input) => {
        
        switch(typeof input){
            case('object'):
            return <div
                style={{
                    display:'gird',
                    gridTemplateColumns: '1fr 1fr 1fr',
                    overflow: 'scroll',
                    width: '200%'
                }}

                >

                {input.map((element)=>{
                    return <React.Fragment>

                    <br></br>
                    
                    <div
                    style={{
                        width: '55vw',
                        padding: '1vh 3vw',
                        border: 'black solid 3.5px',
                        borderRadius: '15px',
                        fontFamily: '큐트신민상',
                        letterSpacing: '1vw',
                        spaceBetween: '5px',
                        lineHeight: '2.5vh'
                    }}
                    >

                        <div>
                    
                            <div
                            style={{
                                display:'flex',
                                flexDirection: 'row',
                                alignItems: 'center'
                                }}
                            >
                                <img
                                src={element.profile_photo_url}
                                style={{
                                width: '10vw'
                                }}
                                ></img>
                                <span
                                style={{
                                paddingLeft: '10px'
                                }}
                                >{element.author_name}</span>
                            </div>

                            <br></br>

                            <div>{start_dispenser(element.rating)}</div>
                        
                        </div>

                        <br></br>

                        <div>{review_text_dispenser(element.text)}</div>

                        

                    </div>
                    
                    </React.Fragment>
                })}
                

                </div>

        }
        
    }

    return <React.Fragment>

    {photo_dispenser(props.photos)}
    {photos_Dot_Index(props.photos)}
    {review_dispenser(props.reviews)}

    </React.Fragment>

}

export default Detail_Image_Section
